"""# **Import Library**"""

import pandas as pd

import numpy as np

import matplotlib.pyplot as plt

import seaborn as sns

"""# **Import Data**"""

df = pd.read_csv('https://github.com/YBI-Foundation/Dataset/raw/main/Bank%20Churn%20Modelling.csv')

"""# **Analyse Data**"""

df.head()

df.info()

df.duplicated('CustomerId').sum()

df = df.set_index('CustomerId')

df.info()

"""# **Encoding**"""

df['Geography'].value_counts()

df.replace({'Geography': {'France': 2, 'Germany':1, 'Spain' :0}}, inplace=True)

df['Gender'].value_counts()

df.replace({'Gender': {'Male': 0, 'Female':1}}, inplace=True)

df['num of products'].value_counts()

df.replace({'Num of Products': {1:0, 2:1, 3:1, 4:1 }}, inplace=True)

df['Has Credit Card'].value_counts()

df['Is Active Member'].value_counts()

df.loc[(df['Balance']==0), 'Churn'].value_counts()

df['Zero Balance'] = np.where(df['Balance']>0, 1, 0)

df['Zero Balance'].hist()

df.groupby(['Churn', 'Geography']).count()

"""# **Define Label and Features**"""

df.columns

X = df.drop(['Surname','Churn'], axis = 1)

Y = df['Churn']

X.shape, Y.shape

"""Handling Imbalance Data

Class Imbalance is a common problem in machine learning, especially in classification problems as machine learning algorithm as designed to maximize accuracy and reduce errors.If the data set is imbalance then in such cases, just by predicting the majority class we get a pretty high accuracy, but fails to captures the minority class, which is most often the point of creating the models in the first place like in   
        1. **Fraud detection**     
        2. **Spam filtering**  
        3. **Disease screening**  
        4. **Online sales churn**   
        5. **Adverting clicks-thoughts**

**Undersampling** can be defined as removing some observations some observations of the majority class. This is done until the majority class is balanced out.   
Undersampling can be a good choice when you have a ton of data-think millions of rows. But a drawback to undersampling is that we are removing information that may be valuable.   
In under-sampling, the simplist technique involves removing random records from the majority class, which can cause loss of information.  
A drawback to consider when undersampling is that it can cause overfitting and poor generaliztion to your test set.  
**Oversampling** can be defined as adding more copies to the minority class. Oversampling can be a good choice when you don't have a ton of data to work with.   
The simplist implementation of over-sampling is to duplicate random records from the minority class, which can cause overfitting.
![sampling.png](data:image/png;base64,)



"""

df['Churn'].value_counts()

sns.countplot(x ='Churn', data = df);

X.shape, Y.shape

"""# **Random Under Sampling**"""

from imblearn.under_sampling import RandomUnderSampler

rus = RandomUnderSampler(random_state=2529)

X_rus, Y_rus = rus.fit_resample(X, Y)

X_rus.shape, Y_rus.shape, X.shape, Y.shape

Y.value_counts()

Y_rus.value_counts()

Y_rus.plot(kind = 'hist')

"""# **Random Over Sampling**"""

from imblearn.over_sampling import RandomOverSampler

ros = RandomOverSampler(random_state=2529)

X_ros, Y_ros = ros.fit_resample(X, Y)

X_ros.shape, Y_ros.shape, X.shape, Y.shape

Y.value_counts()

Y_ros.plot(kind = 'hist')

"""# **Train Test Split**"""

from sklearn.model_selection import train_test_split

"""# **Split Original Data**"""

X_train, X_test, Y_train, Y_test = train_test_split(X,Y, test_size=0.3, random_state=25)

"""# **Split Random Under Sample Data**"""

X_train_rus, X_test_rus, Y_train_rus, Y_test_rus = train_test_split(X_rus, Y_rus, test_size=0.3, random_state=25)

"""# **Split Random Over Sample Data**"""

X_train_ros, X_test_ros, Y_train_ros, Y_test_ros = train_test_split(X_ros, Y_ros, test_size=0.3, random_state=25)

"""# **Standardize Feature**"""

from sklearn.preprocessing import StandardScaler

sc = StandardScaler()

"""# **Standardize Original Data**"""

X_train[['CreditScore','Age','Tenure','Balance','Estimated Salery']] = sc.fit_transform(X_train[['CreditScore', 'Age', 'Tenure', 'Balance','Estimated Salary']])

X_test[['CreditScore','Age', 'Tenure', 'Balance', 'Estimated Salery']] = sc.fit_transform(X_test[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']])

"""# **Standardize Random Under Sample Data**"""

X_train_rus[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']] = sc.fit_transform(X_train_rus[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']])

X_test_rus[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']] = sc.fit_transform(X_test_rus[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']])

"""# **Standardize Random Over Sample Data**"""

X_train_ros[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']] = sc.fit_transform(X_train_ros[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']])

X_test_ros[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']] = sc.fit_transform(X_test_ros[['CreditScore', 'Age', 'Tenure', 'Balance', 'Estimated Salary']])

"""# **Support Vector Machine Classifier**"""

from sklearn.svm import SVC

svc = SVC()

svc.fit(X_train, Y_train)

Y_pred = svc.predict(X_test)

"""# **Model Accuracy**"""

from sklearn.metrics import confusion_matrix, classification_report

confusion_matrix(Y_test, Y_pred)

print(classification_report(Y_test, Y_pred))

"""# **Hyperparameter Tunning**"""

from sklearn.model_selection import GridSearchCV

param_grid = {'C': [0.1,1, 10],
              'gamma': [1,0.1,0.01],
              'kernel': ['rbf'],
              'class_weight' : ['balanced']}

grid = GridSearchCV(SVC(),param_grid,refit=True,verbose=2, cv = 2)
grid.fit(X_train,Y_train)

print(grid.best_estimator_)

grid_predictions = grid.predict(X_test)

confusion_matrix(Y_test, grid_predictions)

print(classification_report(Y_test, grid_predictions))

"""# **Model with Random Under Sampling**"""

